pragma solidity ^0.8.13;

interface ITOKEN {
    function balanceOf(address) external view returns (uint256);
}

contract Tracker {

    function balanceOf(address _user) external view returns (uint256) {
        return ITOKEN(0xCC808545C74910572fdF17cdccEE399c2BC75BfD).balanceOf(_user) + ITOKEN(0xcdB3D3642FB4d48D2B5E4fb4a014448A2761C063).balanceOf(_user);
    }

}
